opinion post: immigration both legal and illegal 
i fully support legal immigration. it helps out economy and brings hard workers who want to be here to work and thrive. i am fully 100% against illegal immigration. with illegal immigration when people are bringing their “kids” most of the time they are actually sex slaves drug mules or other horrendous things. with that said i also believe we need to reform our immigration policies and shorten the wait times for those who are wanting to come here and work and thrive. i also am in 100% support of the wall with how much money we would save just by cutting 20% of illegal immigration off the wall would pay for itself. 
