text:
@academeology #metoo #metooacademia i dropped a math class in ug because my professor wouldn't stop staring at my chest. almost understandably to a point because it is xxlarge and i have a hard time finding shirts. however, this was fall and i hadn't ever worn a low cut shirt to class and on the day of my breaking point i had covered up with a scarf to meet with him about the section i was struggling with. he still stared there.
assult story#9
i was assulted recently (august '18) by a student who lied about being an ewu football player, his age, his life story, and lied to try to, in his mind, trick me into letting him put hands on me. i dropped the case although it was my first time reporting any of my rapes or assults because i am tired of reliving it. i am going to be switching schools in the middle of my master's so i can study without being afraid to go to campus. although there are measures to keep me safe (ewu has a stunning title9 process). he is still there. i can't be. he admitted in his statement that he had been watching me "petition" on campus. which i've only protested. but i hadn't done that for 2 years. he also attempted to smear my name by saying i was retaliating... for what bro? i called the cops on you and told you to not be parked outside of my house waiting for me because this first date is the last i evrrr want to see you face!!! he stalked my social media and pulled pieces from my life so that i would like him. well, he sounded much like my beloved ex boyfriend... i figured it out on the date and thats when i tried to escape and he became enraged his "chris brown" moves weren't working. he threw my dog off of my camping bed that was in my dining room and posted up on my couch. how he even weaseled his body into my home is still a blur. 20 min into tge date he was belittling, berating me, and grabbing my wrists forcing me to "hug" him as he "apologized" for yelling but i was being stupid and failing at giving directions. then he yelled at me for talking too simply... it's all a ruse the whole night he was trying to break me down so he could win me over. well sir,you can't be a knight in shining armor if you are the fire breathing dragon!

